const search=props=>{
    const styles={
        search:{
            'text-align':'Right'
        }
    }
    return(
        <div>
            <form action="http://localhost:4000" method="POST">
            <input type="text"  name="content"></input><br />
            <input type="submit" value="search"></input>
            </form>
        </div>
    )
}
export default search;
